import{_ as n,c as a,o as i,j as e,a as t}from"./chunks/framework.Cv3JQ2Vj.js";const x=JSON.parse('{"title":"贺喜再次成功备案","description":"","frontmatter":{"title":"贺喜再次成功备案","date":"2017-03-07T00:00:00.000Z"},"headers":[],"relativePath":"posts/he-xi-zai-ci-cheng-gong-bei-an.md","filePath":"posts/he-xi-zai-ci-cheng-gong-bei-an.md"}'),o={name:"posts/he-xi-zai-ci-cheng-gong-bei-an.md"},s=e("h1",{id:"贺喜再次成功备案",tabindex:"-1"},[t("贺喜再次成功备案 "),e("a",{class:"header-anchor",href:"#贺喜再次成功备案","aria-label":'Permalink to "贺喜再次成功备案"'},"​")],-1),c=e("p",null,"苦等了那么多天终于是成功的备完了案。这次提交备案到发放备案号总时长花了16天。只算工作日的话那么就是用了14天。比我第一次提交到下号多了1个礼拜(第一次只花了一个礼拜)。而且上次通知成功备案是通过邮件通知的。所以这么多天来一有空就进邮箱。结果这次是中午我还在上课通过短信通知的，没有发邮件，天天手机哪怕没多少电了，也要带着。生怕管局打电话来没接到，刚开始提交备案审核时候还发生了一件趣事。就是我在提交备案给主机商初审的时候。第一次没有通过原因是我名下有一个空壳网站(就是我第一次备案后。没注销。结果被原主机商给取消接入了)。这样我也就只能邮寄资料到管局注销掉这个主体后才能重新提交，在这期间我也问了下朋友，朋友告诉我还可以要原主机商帮你注销。或者是直接打电话给管局要他们帮你注销(需要发e-mail证明材料)。知道了其他的办法后，我也去问了下原主机商。结果他们告诉我。我在他们那里点击注销，已经注销不了了。要我下载注销表格，打印填好后按照表格里的要求发给管局申请注销。我就是不想这样。但好像也就只能这样了。我就去打印了表准备邮寄了。没想到的事情是，我因为不知道收件人联系方式那里不知道填什么，于是又问他们。无意间在后面加了一句 我在你们这里买了个服务器 备不了案。挺急的。结果他们另外一个专员回复我。已经帮我向管局提交了注销申请。我现在可以直接重新备案了。刚开始我还不相信。去ICP官网一查。 果真没有了我的主体备案。于是当天就提交了新备案。这次给我下发的备案号是鄂ICP备17003910号。还记得第一次的备案号是鄂ICP备14015454号。好像这两个备案号都没有什么特殊的含义哈。",-1),r=e("p",null,"另附一张我与原主机商斗志的截图",-1),d=e("p",null,[t("![9(%"),e("code",null,'F$6QEUTY]KI%OIPYQ4P.png](http://shunzi.qiniudn.com/2017/03/201703104272_1204.png "9(%'),t('F$6QEUTY]KI%OIPYQ4P.png")')],-1),h=[s,c,r,d];function l(_,p,g,m,u,P){return i(),a("div",null,h)}const I=n(o,[["render",l]]);export{x as __pageData,I as default};
